import React from 'react'
import './Login.css'

const Signup=()=>{

const submitHandler=(e)=>{
    e.preventDefault();
    const email=document.getElementById('email').value;
    const password=document.getElementById('password').value;
    const cpassword=document.getElementById('cpassword').value;
    alert("email "+email+", password "+password+" cp "+cpassword);
}

    return(
        <div>
        <h2>Signup Form</h2>

<form action="" method="post" onSubmit={submitHandler}>
  {/* <div class="imgcontainer">
    <img src="img_avatar2.png" alt="Avatar" class="avatar"/>
  </div> */}

  <div class="container">
    <label for="uname"><b>Username</b></label>
    <input type="text" placeholder="Enter Email" name="uname" id="email" required/>

    <label for="psw"><b>Password</b></label>
    <input type="password" placeholder="Enter Password" id="password" name="psw" required/>

    <label for="psw"><b>Confim Password</b></label>
    <input type="password" placeholder="Enter Confirm Password" id="cpassword" name="psw" required/>

        
    <button type="submit" >Signup</button>
    {/* <label>
      <input type="checkbox" checked="checked" name="remember"/> Remember me
    </label> */}
  </div>

  <div class="container" style={{"background-color":"#f1f1f1"}}>
    {/* <button type="button" class="cancelbtn">Cancel</button> */}
    {/* <span class="psw">Forgot <a href="/list">password?</a></span> */}
  </div>
</form>
</div>
    );
}

export default Signup;
